
public class PopulationPrint {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int[] nums = new int[25];
		for (int i = 0; i < nums.length; i++) {
			nums[i] = i;
		}
		for (int i = 0; i < nums.length; i++) {
			System.out.println(nums[i]);
		}

	}

}
